DESCR_PRIORIDADE:
[V11][SOLICITAÇÃO DE PAGAMENTO][Controle Orçamentário - Solicitação de Pagamento][ALTA]

Erro: Ao incluir uma nova despesa em uma solicitação e selecionar Tipo de Despesa com "Quilometragem" e clicar no ícone ao lado, o modal aparece pela metade.


Como reproduzir:
1. Na tela de solicitação de pagamento incluir itens em uma solicitação "Pendente";
2. Dentro da capa da uma solicitação clique no botão "Opções" e escolha "Ver Detalhes";
3. Na tela de inclusão de itens da solicitação de pagamento clique em "+" e escolha a opção "Cliente";
4. Preencher Cliente/Caso;
5. Preencher Tipo de Despesa com "Quilometragem" e clicar no ícone ao lado para abrir o modal;
6. Verificar se o modal é totalmente carregado.


Especificações: 
Banco de Dados -> Oracle11 (QA - Ambiente 03)
Browser -> Chrome


